import type {
  ApolloError,
  ApolloQueryResult,
  DocumentNode,
  ErrorPolicy,
  FetchPolicy,
  ObservableQuery,
  OperationVariables,
  QueryOptions,
  SubscribeToMoreOptions,
  SubscriptionOptions,
  WatchQueryOptions,
} from '@apollo/client/core';

import type {
  ApolloQueryInterface,
  ComponentDocument,
  Constructor,
  Data,
  FetchMoreParams,
  RefetchQueriesType,
  Variables,
} from '@apollo-elements/interfaces';

import { NetworkStatus } from '@apollo/client/core';

import { dedupeMixin } from '@open-wc/dedupe-mixin';

import { ApolloElementMixin } from './apollo-element-mixin';

import { booleanAttr, effect, gqlDocument, writable } from '@apollo-elements/lib/descriptors';

type ApolloQueryResultEvent<TData = unknown> =
  CustomEvent<ApolloQueryResult<TData>>;

declare global {
  interface HTMLElementEventMap {
    'apollo-query-result': ApolloQueryResultEvent;
  }
}

type MixinInstance = {
  // eslint-disable-next-line @typescript-eslint/no-explicit-any
  new <D = unknown, V = Record<string, any>>(...a: any[]): ApolloQueryInterface<D, V>;
  documentType: 'query',
}

