    extends ApolloElementMixin(superclass)
    implements Omit<ApolloQueryInterface<D, V>, 'shouldSubscribe'> {
    static documentType = 'query' as const;

    static get observedAttributes(): string[] {
      return [...new Set([
        ...super.observedAttributes ?? [],
        'fetch-policy',
        'next-fetch-policy',
      ])];
    }

